INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10001, 0.0, 1, "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", "クローチェ", "2023/09/22 14:59:59", 2, -470.0, 1, 1.47, 126401, 1, 2002, "2023/06/30 12:00:00");
