INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10003, 0.0, 1, "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", "ライラエル", "2023/09/22 14:59:59", 2, -470.0, 1, 0.0, 126501, 2, 2002, "2023/06/30 12:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10004, 0.0, 2, "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", "ライラエル", "2023/09/22 14:59:59", 1, -470.0, 1, 0.0, 126501, 1, 2002, "2023/06/30 12:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10005, 0.0, 1, "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", "リンド", "2023/12/22 14:59:59", 2, -470.0, 2, 0.0, 127702, 2, 2002, "2023/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10006, 0.0, 2, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", "リンド", "2023/12/22 14:59:59", 2, -470.0, 2, 0.0, 127702, 2, 2002, "2023/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10007, 0.0, 1, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", "ヴルム", "2023/12/22 14:59:59", 1, -470.0, 2, 0.0, 127802, 1, 2002, "2023/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10008, 0.0, 2, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", "ヴルム", "2023/12/22 14:59:59", 1, -470.0, 2, 6.5, 127802, 2, 2002, "2023/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10009, 0.0, 1, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", "アネモネ", "2024/03/22 14:59:59", 1, -470.0, 3, 0.0, 129602, 2, 2002, "2023/12/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10010, 0.0, 2, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", "アネモネ", "2024/03/22 14:59:59", 1, -470.0, 3, 0.0, 129602, 2, 2002, "2023/12/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10011, 0.0, 1, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", "ネフィ=ネラ", "2024/03/22 14:59:59", 1, -470.0, 3, 0.0, 129701, 1, 2002, "2023/12/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10012, 0.0, 2, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", "ネフィ=ネラ", "2024/03/22 14:59:59", 1, -470.0, 3, 6.2, 129701, 2, 2002, "2023/12/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10013, 0.0, 1, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", "カノン", "2024/06/22 14:59:59", 5, -470.0, 4, 3.1, 130301, 3, 2002, "2024/03/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10014, 0.0, 2, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", "カノン", "2024/06/22 14:59:59", 2, -470.0, 4, 6.15, 130301, 3, 2002, "2024/03/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10015, 0.0, 1, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", "ナーナ", "2024/06/22 14:59:59", 2, -470.0, 4, 0.0, 130401, 2, 2002, "2024/03/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10016, 0.0, 2, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", "ナーナ", "2024/06/22 14:59:59", 1, -470.0, 4, 3.35, 130401, 2, 2002, "2024/03/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10017, 0.0, 1, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", "ホウオウ", "2024/09/22 14:59:59", 1, -470.0, 5, 0.0, 130502, 1, 2002, "2024/06/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10018, 0.0, 2, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", "ホウオウ", "2024/09/22 14:59:59", 1, -470.0, 5, 3.18, 130502, 2, 2002, "2024/06/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10019, 0.0, 3, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", "ホウオウ", "2024/09/22 14:59:59", 4, -470.0, 5, 0.0, 130503, 4, 2002, "2024/06/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10020, 0.0, 1, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", "ネア", "2024/09/22 14:59:59", 2, -470.0, 5, 4.9, 123301, 1, 2002, "2024/06/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10021, 0.0, 2, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", "ネア", "2024/09/22 14:59:59", 2, -470.0, 5, 4.8, 123301, 1, 2002, "2024/06/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10022, 0.0, 1, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", "カリザ", "2024/12/22 14:59:59", 1, -470.0, 6, 4.922, 133301, 3, 2002, "2024/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10023, 0.0, 2, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", "カリザ", "2024/12/22 14:59:59", 5, -470.0, 6, 9.638, 133301, 3, 2002, "2024/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10024, 0.0, 1, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", "ミーア", "2024/12/22 14:59:59", 2, -470.0, 6, 2.88, 133401, 1, 2002, "2024/09/15 15:00:00");
INSERT INTO `v1_a99c04748b677c247d1508ca4a077470e9def7b761093353dd91026ddf0f76c0` VALUES (10025, 0.0, 2, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", "ミーア", "2024/12/22 14:59:59", 1, -470.0, 6, 4.818, 133401, 5, 2002, "2024/09/15 15:00:00");
